import logo from './logo.svg';
import './App.css';
import HomePage from "./pages/HomePage.js";

function App() {
  return (
    <div className="App">
      <div className="container" id="Home">
      <div className="navbar">
            <nav>
                <ul>
                    <a href="#" class="logobtn" id="goHomeButton">momento</a>
                    <li><a href = "#" id="goLibraryButton">Library</a></li>
                    <li><a href = "#" id="goQuizButton">Quiz</a></li>
                    <li><a href="">Import</a></li>
                    <a href="" class="signupbtn">Sign Up</a>
                </ul>
            </nav>
        </div>
        <HomePage></HomePage>
      </div>
      </div>
  );
}

export default App;
